;; gorilla-repl.fileformat = 1

;; **
;;; # Demo of ggplot charts via r-wrapper
;;;  There is a bug in ggplot wrapper, so I had to fork a gg4clj fork and then 
;;; 
;;; git clone git@github.com:awb99/gg4clj.git
;;; lein install
;;; 
;;; my project.clj has the new dependency version number [gg4clj "0.1.7"]
;;; 
;;; The alternative would be to require from github directly:
;;; - https://lambdaisland.com/blog/2017-05-17-loading-clojure-libraries-directly-from-github
;;; - https://github.com/RickMoynihan/lein-tools-deps is more geared towards using deps directly from git, 
;;; - https://github.com/reifyhealth/lein-git-down works beautifully and cleanly.
;;; 
;;; doesn't matter if you publish it under your org, for example com.github.andy27/gg4clj. (bearbeitet) 
;; **

;; @@
(ns data.gorillaplot
  (:require 
   [gorilla-plot.core :as plot]
   [gorilla-repl.html :as html]
   [gg4clj.core :as gg4clj]
   ))
;; @@
