;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def xs (range 0 10 1))
(def ys (map #(Math/sin %) xs))
(def dat {:x xs :y ys})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;data.gorillaplot/dat</span>","value":"#'data.gorillaplot/dat"}
;; <=

;; **
;;; Show how the data structure looks in r:
;; **

;; @@
(gg4clj/to-r [[:<- :d (gg4clj/data-frame dat)]
                       [:qplot :x :y {:data :d :geom [:c "point" "line"]}]])
